import React from "react";

function Prob5() {
  return (
    <div>
      <p className="probp"></p>
      <p className="probp">Five friends competed in a race.</p>
      {/* <div style={{background:"#f0f0f0"}} */}
      <ul>
        <li>
          <p className="probp">Pyrrha finished faster than Blake.</p>
        </li>
        <li>
          <p className="probp">The <b>smallest </b>difference in finishing times was between Pyrrha and Ruby.</p>
        </li>
        <li>
          <p className="probp">The largest difference in finishing times was between Ruby and Weiss.</p>
        </li>
        <li>
          <p className="probp">Yang finished either </p>
        </li>
      </ul>
      {/* </div> */}
    </div>
  );
}

export default Prob5;
